import React, { Component } from 'react';

class AddTeam extends Component {

    state = {
        name:"",
        founded: 0
    }

    handleChange = (event) => {
        console.log(event.target)
    }
    render() {
        return (
          <form>
            <div class="field">
              <label>Team Name:</label>
              <input
                name="name"
                type="text"
                onChange={this.handleChange}
              />
            </div>
            <div class="field">
              <label>Founded:</label>
              <input
                name="founded"
                type="text"
                onChange={this.handleChange}
              />
            </div>
            <button>Add</button>
          </form>
        );
    }
}

export default AddTeam;
